export default {
  title: 'GeoIP Filter schema',
  type: 'object',
  properties: {
    blockedCountries: {
      type: 'array',
      items: {
        type: 'string',
      },
    },
    enabled: { type: 'boolean' },
    enabledLog: { type: 'boolean' },
    passedNetworks: {
      type: 'array',
      items: {
        type: 'object',
        properties: {
          address: { type: 'string' },
          description: { type: 'string' },
        },
        required: ['address', 'description'],
        additionalProperties: false,
      },
    },
  },
  required: ['blockedCountries', 'enabled', 'enabledLog', 'passedNetworks'],
  additionalProperties: false,
}
